import React from "react";
import { Elements } from "@stripe/react-stripe-js";
import { loadStripe } from "@stripe/stripe-js";
import CheckoutForm from "./CheckoutForm";

// Make sure to call `loadStripe` outside of a component’s render to avoid
// recreating the `Stripe` object on every render.
const stripePromise = loadStripe(
  "pk_test_51IuUJWSF5nA10n6KHUJqTqrMIl8pY9AVN4dGGhUczKW6oqziMLPLcKwby3wHxGkEkgwklenf27MlEtU6AwGEagP900gbCNQ88x"
);

const Payment = () => {
  const options = {
    // passing the client secret obtained in step 3
    clientSecret:
      `pi-123${sk_test_51IuUJWSF5nA10n6KCOvf79qT0L2T3KNivjjFDYEpNfWwI01BoRe2pQyXfgKA7UHarj0Lo4vcnCjeBiLPoJylZjRS00XeS9ws2N}_123`,
  };

  return (
    <Elements stripe={stripePromise} options={options}>
      <CheckoutForm />
    </Elements>
  );
};

export default Payment;
